$url: "https://raw.githubusercontent.com/ParkYoungWoong/overwatch-hero-selector-vanilla/master/images";

body {
  height: 100vh;
  background-image: url("#{$url}/bg.jpg");
  background-size: cover;
  background-repeat: no-repeat;
  background-attachment: fixed;
}
.container {
  padding: 50px 0;
  .heroes { // 중첩처리.
    display: flex;
    /* 줄바꿈 */
    flex-wrap: wrap;
    justify-content: center;
    max-width: 700px;
    /* 블럭요소 + 가로길이 + margin => 가운데 정렬(좌우) */
    margin: 0 auto;
    padding: 40px 20px;
    .hero {
      width: 80px;
      height: 84px;
      margin: 4px;
      border: 3px solid #fff;
      border-radius: 10px;
      /* box-sizing : border가 들어갔을 때 원하는 사이즈를 유지 하기 위해서 사용 */
      box-sizing: border-box;
      background-color: #555;
      /* 캐릭터 이미지 사이즈 조정 */
      overflow: hidden;
      transform: skewX(-14deg);
      /* 전환효과 */
      transition:  
        transform .1s, 
        background-color .6s;
      &:hover { // hero에 가상클래스 붙여주기.
          background-color: #ff9c00;
          /* transform이 재정의 되기 때문에 skewX(기울임)을 다시 작성해주어야 햠. */
          transform: skewX(-14deg) scale(1.3);
          /* 쌓임순서 => 가장앞으로 가져오기 1 */
          z-index: 1;
      }
      .image {
        width: 140%;
        height: 100%;
        background-position: center;
        background-repeat: no-repeat;
        background-size: 90px;
        /* 이미지가 찌그러지지 않도록 부모와 반대로 기울여 원상복귀 */
        transform: skewX(14deg) translateX(-16px);
      }
      @for $i from 1 through 32 {
        // .hero
        &:nth-child(#{$i}) .image {
          background-image: url("#{$url}/hero#{$i}.png");
        }
      }
    }
  }
  /* heroes에 대한 정의가 끝나고 형제요소인 Logo요소 내용 */
  .logo {
    max-width: 300px;
    margin: 0 auto;
    padding: 0 20px;
    img {
      width: 100%;
    }
  }
}

